import React, { useState, useEffect } from "react";
import {Line} from "react-chartjs-2";

function Chart() {
    const [chartData, setChartData] = useState({})

    const chart = () => {
        setChartData({
            labels: ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday"],
            datasets: [
                {
                    label: "Temperatures in deg-F",
                    data: [82, 85, 70, 69, 89],
                    backgroundColor: [
                        "rgba(75, 192, 192, 0.6)"
                    ],
                    borderWidth: 4
                }
            ]
        })
    }

    useEffect(() => {
        chart()
    }, [])

    return (
        <div>
            <h1>F1 Fantasy Prices</h1>
            <div>
                <Line data={chartData} options={{
                    responsive: true,
                    title: {text: "F1 Price Comparison Over 2021 Season"},
                    scales: {
                        yAxes: [
                            {
                                ticks: {
                                    autoSkip: true,
                                    maxTicksLimit: 10,
                                    beginAtZero: true
                                },
                                gridLines: {
                                    display: false
                                }
                            }
                        ],
                        xAxes: [
                            {
                                gridLines: {
                                    display: false
                                }
                            }
                        ]
                    }
                }} />
            </div>
        </div>
    );
}

export default Chart;
